import React, { useState } from "react";

export const TodoForm: React.FC = () => {
  const [title, setTitle] = useState("");

  return (
    <div className="input-field mt2">
      <input
        value={title}
        type="text"
        id="title"
        placeholder="Enter Todo title"
      />
      <label htmlFor="title" className="active">
        Enter Todo title
      </label>
    </div>
  );
};
